import React from 'react';
import { TextField, Typography, Box } from '@material-ui/core';

const Filter = ({ onChangeHandler}) => (
  <Box style={{paddingRight:10}}>
    <TextField
      id="filled-basic"
      onChange={onChangeHandler}
      label="Search"
    />
  </Box>

);

export default Filter;
